import React from "react";

function AccountTypes({ heading, text, icon }) {
  return (
    <div className="container mb-5 p-5 border">
      <div className="row">
        {icon}
        <h4>{heading}</h4>
      </div>

      <p className="fs-5">{text}</p>
    </div>
  );
}

export default AccountTypes;
